    [],nt"revision_timestamp": "2016-07-27T22:55:39.676635",nt"name": "necedah-national-wildlife-refuge-annual-narrative-report-calendar-year-1985",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Necedah
    NWR outlines Refuge accomplishments during the 1985 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. The report includes
    a planning section which discusses the master plan, management planning, public
    participation, and research and investigations. Refuge administration is outlined;
    information about personnel, youth programs, volunteer programs, funding, and safety
    is given. Habitat management is also covered; subjects include wetlands, forests,
    croplands, grasslands, fire management, pest control, and wilderness areas. The
    wildlife section of the report discusses wildlife diversity, endangered and threatened
    species, waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals,
    fisheries resources, animal control, marking and bird banding, and disease control.
    The public uses of the Refuge described in this report include interpretive programs,
    hunting, fishing, trapping, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about rehabilitation,
    equipment replacement, communication systems, and energy conservation. Cooperative
    programs and items of interest are provided at the end. Refuge brochures and newspaper
    articles are attached.",nt"license_title": "License Not Specified",nt"extras":
